import SpotInfo from "./SpotInfo";
import { List, Segmented, Avatar } from 'antd';

function SpotInfoListView({ spotList = [] }) {
    return (
        // <div>
        //     {spotList.map(spot => (<SpotInfo key={spot.id} info={spot} />))}
        // </div>
        <List
        style={{padding: '20px'}}
        itemLayout="horizontal"
        dataSource={spotList}
        renderItem={(item) => (
          <List.Item>
            <List.Item.Meta
              avatar={<Avatar size="small" shape="square" style={{ backgroundColor: '#87d068' }}>{item.id}</Avatar>}
              title={item.spot}
            />
          </List.Item>
        )}
      />
    );
}

export default SpotInfoListView
